const POZIOM_TRUDNOSCI = 3; // 1 albo 2 albo 3

// MIEJSCE NA TWÓJ KOD
const uzytePaszporty = {};

/**
 *
 * @param {number} aktualnyNumerDnia dzisiejszy numer dnia
 * @param {{id: number, imie: string, nazwisko: string, wygasa: number, zdjecie: string, narodowosc: string, sumaKontrolna: number, wiek: number}} paszport dane paszportowe
 * @returns {boolean} wynik kontroli
 */
function kontrola(aktualnyNumerDnia, paszport) {
  // (tę funkcje wywoła kod sprawdzający wyniki gdy uruchomisz program)

  const czarnaLista = ["BOŚNIA", "ROSJA", "WATYKAN"];

  if (POZIOM_TRUDNOSCI === 1) {
    if (paszport === undefined) return false;
    if (paszport.wygasa <= aktualnyNumerDnia) return false;
    if (czarnaLista.includes(paszport.narodowosc)) return false;
    if (paszport.wiek < 18) return false;
  } else if (POZIOM_TRUDNOSCI === 2) {
    if (paszport === undefined) return areszt();

    const record = kartoteka(paszport.id);
    if (record === undefined) return areszt();

    for (const key in record) {
      if (record[key] !== paszport[key]) return areszt();
    }

    const sumaKontrolna = 2137 * paszport.wygasa * paszport.id;
    if (sumaKontrolna !== paszport.sumaKontrolna) return areszt();

    if (paszport.wygasa <= aktualnyNumerDnia) return false;
    if (czarnaLista.includes(paszport.narodowosc)) return false;
    if (paszport.wiek < 18) return false;
  } else if (POZIOM_TRUDNOSCI === 3) {
    if (paszport === undefined) return areszt();

    if (paszport.imie === "Jacek" && paszport.nazwisko === "Jaworek")
      return areszt();

    if (uzytePaszporty.hasOwnProperty(aktualnyNumerDnia) === false)
      uzytePaszporty[aktualnyNumerDnia] = [];

    if (uzytePaszporty[aktualnyNumerDnia].includes(paszport.id))
      return areszt();

    const record = kartoteka(paszport.id);
    if (record === undefined) return areszt();

    for (const key in record) {
      if (record[key] !== paszport[key]) return areszt();
    }

    const sumaKontrolna = 2137 * paszport.wygasa * paszport.id;
    if (sumaKontrolna !== paszport.sumaKontrolna) return areszt();

    if (paszport.wygasa <= aktualnyNumerDnia) return false;
    if (czarnaLista.includes(paszport.narodowosc)) return false;
    if (paszport.wiek < 18) return false;
    uzytePaszporty[aktualnyNumerDnia].push(paszport.id);
  }

  return true; // true = przepuszczamy petenta - false = nieprzepuszczamy - areszt() = aresztujemy typa
}

